from flask import Flask, request
from text_to_image import *
from model.resolution import super_resolve
import base64

app = Flask(__name__)

api = Text2ImageAPI('https://api-key.fusionbrain.ai/',
                    '0E8304C916C8A0D2A63B6D58820DB253',
                    'A4CA30389EC1BE639594E6C144523A14')

model_path = 'back/python/model/SUB_model_path.pth'



image = ""


def write():
    img = base64.decodestring(image)
    imgFile = open('image.png', 'wb')
    imgFile.write(img)
    imgFile.close()


#write()




@app.route('/api/v1/models')
def get_model():
    return str(api.get_model())


@app.route('/api/v1/generate', methods=['GET', 'POST'])
def generate():
    result = json.loads(request.data)
    id_model = api.get_model()
    return str(api.generate(result['params']['generateParams']['query'], id_model, result['params']['numImages'],
                            result['params']['width'], result['params']['height']))


@app.route('/api/v1/check_generation')
def check_generation():
    return str(api.check_generation(json.loads(request.data)['uuid']))


@app.route('/api/v1/super_resolution')
def super_resolution():
    image = json.loads(request.data)['image']
    resolution = json.loads(request.data)['resolution']
    output_image = f'art_{resolution}.png'
    super_resolve(image, model_path, output_image)


app.run()
